--
-- Estructura de tabla para la tabla `fm_inventario_producto`
--

CREATE TABLE `fm_inventario_producto` (
  `PROD_CODIGO` int(11) NOT NULL,
  `PROD_CODPRO` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'CODIGO DEL PRODUCTO',
  `PROD_CODAUX` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'CODIGO DE BARRAS',
  `PROD_CATEGO` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'CATEGORIA DEL PRODUCTO',
  `PROD_NOMBRE` varchar(500) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `PROD_TIPOXX` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'PRODUCTO O SERVICIO',
  `PROD_PERECI` char(2) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `PROD_ADSTOC` char(2) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT 'PREGUNTA SI VA A PERMITIR ADMINISTRAR STOCK',
  `PROD_STOCKX` int(11) NOT NULL COMMENT 'STOCK DEL PRODUCTO',
  `PROD_STOMIN` int(11) NOT NULL,
  `PROD_STOMAX` int(11) NOT NULL,
  `PROD_FECCAD` date DEFAULT NULL COMMENT 'FECHA DE CADUCIDAD DEL PRODUCTO',
  `PROD_MARCAX` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'MARCA DEL PRODUCTO',
  `PROD_UNIDAD` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'UNIDAD DE MEDIDA DEL PRODUCTO',
  `PROD_PROCES` char(2) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'PRODUCTO PROCESADO',
  `PROD_COMISI` decimal(12,4) NOT NULL COMMENT 'PORCENTAJE DE COMISION',
  `PROD_OBSERV` varchar(300) CHARACTER SET utf8mb4 DEFAULT '' COMMENT 'OBSERVACION DEL PRODUCTO',
  `PROD_PCOSTO` decimal(12,4) NOT NULL COMMENT 'COSTO DEL PRODUCTO',
  `PROD_PVPUB` decimal(12,4) NOT NULL COMMENT 'PRECIO DE VENTA AL PUBLICO',
  `PROD_PVDIST` decimal(12,4) NOT NULL COMMENT 'PRECIO DE DISTRIBUCION',
  `PROD_PVMAYO` decimal(12,4) NOT NULL COMMENT 'PRECIO MAYORISTA',
  `PROD_PVLIQU` decimal(12,4) NOT NULL COMMENT 'PRECIO DE LIQUIDACION',
  `PROD_TIEIVA` varchar(15) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT 'EL PRODUCTO TIENE O NO IVA',
  `PROD_OFERTA` char(2) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'PRODUCTO TIENE OFERA SI O NO',
  `PROD_TIPPRO` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'TIPO DE PRODUCTO',
  `PROD_FOTVIS` char(2) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'FOTO VISIBLE O NO',
  `PROD_FOTOXX` varchar(200) CHARACTER SET utf8mb4 DEFAULT '' COMMENT 'FOTO DEL PRODUCTO',
  `PROD_FICTEC` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'FICHA TECNICA DEL PRODUCTO',
  `PROD_ESTADO` varchar(15) CHARACTER SET utf8mb4 NOT NULL DEFAULT '',
  `PROD_USUING` varchar(80) CHARACTER SET utf8mb4 NOT NULL DEFAULT '',
  `PROD_FECING` datetime NOT NULL,
  `PROD_USUMOD` varchar(80) CHARACTER SET utf8mb4 NOT NULL,
  `PROD_FECMOD` datetime NOT NULL,
  `PROD_USUANU` varchar(80) CHARACTER SET utf8mb4 DEFAULT '',
  `PROD_FECANU` datetime DEFAULT NULL,
  `IICE_CODIGO` int(11) NOT NULL,
  `PROD_SOLVAR` varchar(8) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'SI MANEJA SOLO PVP O TODOS',
  `PROD_TIPPRE` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'TIPO DE PRECIO POR PORCENTAJE O FIJOS',
  `PROD_PORPVP` decimal(12,4) DEFAULT NULL,
  `PROD_PORDIS` decimal(12,4) DEFAULT NULL,
  `PROD_PORMAY` decimal(12,4) DEFAULT NULL,
  `PROD_PORLIQ` decimal(12,4) DEFAULT NULL,
  `PROD_FARM_PREMED` char(2) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'PRESCIPCIÓN MÉDICA',
  `PROD_FARM_EMBLAC` char(2) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'EMBARAZO/LACTANCIA',
  `PROD_FARM_PRESEN` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'PRESENTACIÓN',
  `PROD_FARM_VIADMI` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'VÍA DE ADMINISTRACIÓN',
  `PROD_FARM_GRUTER` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'GRUPO TERAPÉUTICO',
  `PROD_FARM_LABORA` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'LABORATORIO',
  `PROD_FARM_PRIACT` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'PRINCIPIO ACTIVO',
  `PROD_FARM_DOSFRE` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'DOSIS/FRECUENCIA',
  `PROD_FARM_INDMED` text COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'INDICACIONES MÉDICAS',
  `PROD_FARM_TIPIND` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'TIPO DE INDICACIÓN',
  `PROD_UNIDADESCAJA` int(11) DEFAULT 1,
  `PROD_COSTOMARCADOCAJA` decimal(12,2) NOT NULL DEFAULT 0.00,
  `PROD_COSTOMARCADOUNIDAD` decimal(12,4) DEFAULT 0.0000,
  `PROD_MODELO` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT 'SN',
  `PROD_TIPOPLAN` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `PROD_ANTIVIRUS` char(2) COLLATE utf8mb4_unicode_ci DEFAULT 'NO',
  `PROD_TIPOANTIVIRUS` int(11) DEFAULT 0,
  `PROD_PRECIOANTI` decimal(12,4) DEFAULT 0.0000,
  `PROD_PRECIOPLAN` decimal(12,4) DEFAULT 0.0000,
  `PROD_CINGRESOS` int(11) DEFAULT 0,
  `PROD_CCOSTOS` int(11) DEFAULT 0,
  `PROD_CINVENTARIO` int(11) DEFAULT 0
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC;

