(184921, '2022-12-06 16:32:27', 'SN', 'SN', 'SELECT detalles.PLCU_CODIGO, PLCU_CODPLAN, PLCU_NOMBRE FROM fm_contabilidad_plancuentas as cuentas\r\n            INNER JOIN fm_contabilidad_asientosdetalle as detalles\r\n            ON detalles.PLCU_CODIGO = cuentas.PLCU_CODIGO\r\n            INNER JOIN fm_contabilidad_asientos as asientos\r\n            ON asientos.ASIE_CODIGO = detalles.ASIE_CODIGO\r\n            WHERE detalles.CECO_CODIGO IS NOT NULL AND  asientos.ASIE_ORIGEN IS NOT NULL AND  cuentas.PLCU_CODIGO = \"11\" AND ASIE_FECHAX BETWEEN \'2022-01-01\' AND \'2022-12-06\'', 'SELECT', 'FORMULARIO', 'SN'),
